import React from 'react'

export default function Pairimg(props) {
    return (
        <div className="pairimg">
            <img className="sm-tk-img ab-l-t" src={props.img1}/>
            <img className="sm-tk-img ab-r-b" src={props.img2}/>
        </div>
    )
}
